import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from 'react-router-dom';
import NavBar from '../../components/NavBar';
import Login from '../Login';
import Home from '../Home';
import NotFound from '../NotFound';

const Routes = () => (
  <Router>
    <NavBar />
    <Switch>
      <Route exact path="/">
        <Login />
      </Route>
      <Route path="/home">
        <Home />
      </Route>
      <Route>
        <NotFound />
      </Route>
    </Switch>
  </Router>
);

export default Routes;
